import React from "react";
import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Navigation from "./components/Navigation";
import { Jumbotron, Button } from "react-bootstrap";

function App() {
  return (
    <div className="App">
      <Navigation />
      <Jumbotron>
        <h1>Welcome to Guu Garden!</h1>
        <p>his page use voice Recognition.    Just speak! we will open new pages for you!</p>
        <p>*Tips*</p>
        <p>For main page: speak "Go home"</p>
        <p>For check reservation: speak "Reservation"</p>
        <p>For ehcek tables: speak "Table"</p>

        <p>
          <Button variant="primary">Learn more</Button>
        </p>
      </Jumbotron>
    </div>
  );
}

export default App;
